import React, { useState, useEffect } from 'react';

function TestPage() {
  const [status, setStatus] = useState('Loading...');
  const [products, setProducts] = useState([]);
  const [error, setError] = useState(null);

  useEffect(() => {
    const apiUrl = process.env.REACT_APP_API_URL || 'http://localhost:5000';

    fetch(`${apiUrl}/api/products`)
      .then(response => {
        if (!response.ok) {
          throw new Error(`HTTP ${response.status}: ${response.statusText}`);
        }
        return response.json();
      })
      .then(data => {
        setProducts(data);
        setStatus(`‚úÖ Success! Loaded ${data.length} products`);
      })
      .catch(err => {
        setError(err.message);
        setStatus(`‚ùå Error: ${err.message}`);
      });
  }, []);

  return (
    <div style={{ padding: '20px', fontFamily: 'Arial, sans-serif' }}>
      <h1>üß™ E-commerce App Test Page</h1>

      <div style={{ marginBottom: '20px', padding: '15px', border: '1px solid #ddd', borderRadius: '5px' }}>
        <h2>üìä Status</h2>
        <p><strong>API Status:</strong> {status}</p>
        <p><strong>API URL:</strong> {process.env.REACT_APP_API_URL || 'http://localhost:5000'}</p>
        <p><strong>Environment:</strong> {process.env.NODE_ENV || 'development'}</p>
      </div>

      {error && (
        <div style={{ marginBottom: '20px', padding: '15px', border: '1px solid #ff6b6b', borderRadius: '5px', backgroundColor: '#ffe0e0' }}>
          <h2>‚ùå Error Details</h2>
          <p>{error}</p>
          <p><strong>Possible solutions:</strong></p>
          <ul>
            <li>Make sure the backend server is running on port 5000</li>
            <li>Check if CORS is properly configured</li>
            <li>Verify the API endpoint exists</li>
          </ul>
        </div>
      )}

      {products.length > 0 && (
        <div style={{ marginBottom: '20px', padding: '15px', border: '1px solid #4caf50', borderRadius: '5px', backgroundColor: '#e8f5e8' }}>
          <h2>‚úÖ Products Loaded Successfully</h2>
          <p>Found {products.length} products:</p>
          <ul>
            {products.slice(0, 5).map(product => (
              <li key={product._id}>
                {product.name} - ${product.price}
              </li>
            ))}
            {products.length > 5 && <li>... and {products.length - 5} more</li>}
          </ul>
        </div>
      )}

      <div style={{ marginTop: '30px', padding: '15px', border: '1px solid #2196f3', borderRadius: '5px', backgroundColor: '#e3f2fd' }}>
        <h2>üîß Next Steps</h2>
        <p>If this page shows "Success", your backend is working correctly!</p>
        <p>If you see errors, check:</p>
        <ol>
          <li>Backend server is running: <code>cd server && node server.js</code></li>
          <li>No port conflicts (port 5000 should be free)</li>
          <li>CORS is configured properly</li>
          <li>Environment variables are set correctly</li>
        </ol>
        <button 
          onClick={() => window.location.href = '/'}
          style={{
            marginTop: '10px',
            padding: '10px 20px',
            backgroundColor: '#2196f3',
            color: 'white',
            border: 'none',
            borderRadius: '4px',
            cursor: 'pointer'
          }}
        >
          Go to Home Page
        </button>
      </div>
    </div>
  );
}

export default TestPage;
